Description:
FAMILY LIVING CLOSE TO EVERYTHING!!!
For those families looking for the larger homes know how difficult it is to get a 5 bedroom one until NOW!!!!!
Looking to expand or just need the extra space???? Then take a look at this family size brick residence conveniently located in the popular growing township of Lang Lang and only minutes to dual lane highway for easy commute.
The home is situated on a large 1,122sq.m. residential block in an appealing court location and is within walking distance to the local primary school, park and shops which includes a supermarket, bus services and other amenities.
The floor plan of this home is well suited to a large family with the master bedroom, en suite and walk-in-robe at the front of the home next to the formal lounge and office area. The centrally positioned wood heater keeps the home warm over the winter and the ceiling fans throughout keep the summer heat at bay. Following through into the meals area you will find a spacious kitchen with ample cupboards, dishwasher and wall oven. The large bench overlooks a spacious living/rumpus area keeping in style with open plan living. The other 4 bedrooms, 3 of which have b/i/r/s are situated off the hallways surrounding the living areas. The family bathroom includes a separate bath and shower and the laundry has an external door to outside.
From the living/rumpus room you have access to the impressive undercover large entertaining area to host all those memorable parties and added to the entertaining side is an in ground pool (which needs some attention) with paved surrounds and pool fencing. There is still plenty of space out in the fully fenced backyard for the kids/pets to run around.
Additional features -
Split-system aircon;
Gas heater;
Double carport;
Concrete driveway;
Large gate for access to backyard for extra vehicles;
Garden shed;
Mains gas available out front of property.
This is an affordable family home and with some tlc would make a very enjoyable lifestyle for all your family and friends to visit.
